import './App.css';
import NavBar from './NavBar.jsx'
import Pricing from './pages/Pricing'
import About from './pages/About'
import Home from './pages/Home'

function App() {
let component
  switch (window.location.pathname) {
    case "/":
      component = <Home/>
      break
    case "/pricing":
      component = <Pricing/>
      break
    case "/about":
      component = <About/>
      break
  }
  return (
      <header className="page-background">
        <div className="title">
          Ryan's Workshop
        </div >

        <NavBar/>

        {component}

      </header>
  );
}

export default App;
